import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/SearchPanel.css';

function SearchPanel({ metadata, onSearch, onError }) {
  const [uniqueClasses, setUniqueClasses] = useState([]);
  const [countOptions, setCountOptions] = useState({});
  const [selectedClasses, setSelectedClasses] = useState([]);
  const [searchMode, setSearchMode] = useState('OR');
  const [thresholds, setThresholds] = useState({});
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchClasses();
  }, [metadata]);

  const fetchClasses = async () => {
    try {
      const response = await axios.post('/api/get-classes', { metadata });
      setUniqueClasses(response.data.classes);
      setCountOptions(response.data.countOptions);
      setThresholds({});
      setSelectedClasses([]);
    } catch (error) {
      onError('Error fetching classes');
    }
  };

  const toggleClass = (cls) => {
    if (selectedClasses.includes(cls)) {
      setSelectedClasses(selectedClasses.filter(c => c !== cls));
      const newThresholds = { ...thresholds };
      delete newThresholds[cls];
      setThresholds(newThresholds);
    } else {
      setSelectedClasses([...selectedClasses, cls]);
      setThresholds({ ...thresholds, [cls]: 'None' });
    }
  };

  const handleThresholdChange = (cls, threshold) => {
    setThresholds({ ...thresholds, [cls]: threshold });
  };

  const handleSearch = async () => {
    if (selectedClasses.length === 0) {
      onError('Please select at least one class');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('/api/search', {
        metadata,
        searchParams: {
          selectedClasses,
          searchMode,
          thresholds
        }
      });

      if (response.data.success) {
        onSearch(response.data.results);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Search error');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="search-panel">
      <div className="search-header">
        <h2>üîç Search Objects in Images</h2>
        <p>Select one or more object classes to filter images</p>
        <div className="classes-summary">
          <span>üìä <strong>{uniqueClasses.length}</strong> object classes found</span>
          {selectedClasses.length > 0 && (
            <span>‚úì <strong>{selectedClasses.length}</strong> selected</span>
          )}
        </div>
      </div>

      <div className="search-section">
        <h3>Search Mode</h3>
        <div className="search-mode-options">
          <label>
            <input
              type="radio"
              value="OR"
              checked={searchMode === 'OR'}
              onChange={(e) => setSearchMode(e.target.value)}
            />
            Any of selected classes (OR) - Image contains at least one selected object
          </label>
          <label>
            <input
              type="radio"
              value="AND"
              checked={searchMode === 'AND'}
              onChange={(e) => setSearchMode(e.target.value)}
            />
            All selected classes (AND) - Image contains all selected objects
          </label>
        </div>
      </div>

      <div className="search-section">
        <h3>Select Classes</h3>
        <div className="classes-grid">
          {uniqueClasses.map((cls) => (
            <div key={cls} className="class-item">
              <label className="class-label">
                <input
                  type="checkbox"
                  checked={selectedClasses.includes(cls)}
                  onChange={() => toggleClass(cls)}
                />
                <span>{cls}</span>
              </label>
            </div>
          ))}
        </div>
      </div>

      {selectedClasses.length > 0 && (
        <div className="search-section">
          <h3>Count Thresholds (Optional)</h3>
          <div className="thresholds-grid">
            {selectedClasses.map((cls) => (
              <div key={cls} className="threshold-item">
                <label>{cls}</label>
                <select
                  value={thresholds[cls] || 'None'}
                  onChange={(e) => handleThresholdChange(cls, e.target.value)}
                >
                  <option value="None">None</option>
                  {countOptions[cls]?.map((count) => (
                    <option key={count} value={count}>
                      {count}
                    </option>
                  ))}
                </select>
              </div>
            ))}
          </div>
        </div>
      )}

      <button
        className="btn btn-search"
        onClick={handleSearch}
        disabled={loading || selectedClasses.length === 0}
      >
        {loading ? 'Searching...' : 'üîç Search Images'}
      </button>
    </div>
  );
}

export default SearchPanel;
